import React from 'react'
import { useLocation } from 'react-router-dom';

export default function CostumerDetails(props) {

    const location = useLocation();
    // const {costumerData} = location.state;
    const costumersArray = props.costumersArray;
    // console.log(costumerData);
    
  return (
    <div>
      <p>{costumersArray.name}</p>
      <p>{costumersArray.id}</p>
      <p>{costumersArray.address}</p>
      <p>{costumersArray.phoneNumber}</p>
      <p>{costumersArray.plateNumber}</p>
    </div>
  );
}
